Фрега́т (від італ. fregata, англійською frigate, французькою frégate, німецькою fregatte, іспанською та португальською fragata, турецькою firkateyn )— тип військових кораблів (за класифікацією НАТО) або клас, відповідно до термінології військовоморських джерел — військові кораблі, що спроможні самостійно здійснювати операції у відкритому морі. Фрегати також можуть виконувати роль ескорту як додаткова допомога в бойових з'єднаннях військових кораблів. Наприклад, мати функції протичовнової боротьби, захисту авіаносців або інших великих кораблів. У сучасній військовій термінології фрегат — надводний військовий корабель середнього розміру та озброєння його обладнання дозволяє: 
* плавати у відкритому морі за будь-яких погодних умов; 
* використовувати для нападу та захисту від підводних човнів, літаків чи інших суден; 
* опціонально для атаки наземних цілей; 
* діяти самостійно або у складі військово-морських сил. У ВМС НАТО: 
* В візуальному позивному для фрегатів передує «D» ( есмінець або фрегат 1-го рангу ) або «F» ( фрегат або фрегат 2- го рангу) для суден меншої водотоннажності (фрегати спостереження, фрегати легкі таємні, для зв'язку); 
* кодове позначення: «FF», «FFG» (оснащені ракетами «земля-повітря »), «FFH» (вертольотоносець). Тоннаж фрегатів становить від 2000 до 7000 тонн; менші, прирівнюються до корветів або патрульних катерів, а більші та універсальніші, до крейсерів . Слово «фрегат» походить від італійського «fregata» і вперше згадується у літературі в «Декамероні» (1350р.). Подальша його етимологія повністю не з'ясована Деякі дослідники ведуть історію поняття від лат. «navis fabricata», що означає «збудований корабель». У 16 ст. в Європі ця назва поширилась на різноманітні типи відносно невеликих швидких військових суден.
